    <!-- Google Fonts for typography similar to McKinsey -->
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Merriweather:wght@400;700&family=Inter:wght@300;400;500;600;700&display=swap" rel="stylesheet">
    
    <!-- Custom styles to match McKinsey's aesthetic -->
    <style>
        :root {
            --mckinsey-blue: #051c2c;
            --mckinsey-light-blue: #0076ce;
            --mckinsey-gray: #f5f5f5;
        }
        
        /* Base styles */
        body {
            font-family: 'Inter', 'Helvetica Neue', Arial, sans-serif;
            color: #333;
            line-height: 1.5;
            overflow-x: hidden;
            width: 100%;
        }
        
        /* Responsive text sizing */
        @media (max-width: 640px) {
            html {
                font-size: 14px;
            }
        }
        
        @media (min-width: 641px) and (max-width: 1024px) {
            html {
                font-size: 15px;
            }
        }
        
        @media (min-width: 1025px) {
            html {
                font-size: 16px;
            }
        }
        
        /* Container responsiveness */
        .container {
            width: 100%;
            padding-right: 1rem;
            padding-left: 1rem;
            margin-right: auto;
            margin-left: auto;
        }
        
        @media (min-width: 640px) {
            .container {
                padding-right: 2rem;
                padding-left: 2rem;
            }
        }
        
        @media (min-width: 1024px) {
            .container {
                padding-right: 4rem;
                padding-left: 4rem;
            }
        }
        
        /* Responsive navigation */
        .mobile-menu {
            display: none;
        }
        
        @media (max-width: 1023px) {
            .desktop-menu {
                display: none;
            }
            .mobile-menu {
                display: block;
            }
        }
        
        /* Responsive grid layouts */
        .grid-container {
            display: grid;
            gap: 1rem;
            width: 100%;
        }
        
        @media (min-width: 640px) {
            .grid-container {
                grid-template-columns: repeat(2, 1fr);
                gap: 2rem;
            }
        }
        
        @media (min-width: 1024px) {
            .grid-container {
                grid-template-columns: repeat(3, 1fr);
                gap: 2.5rem;
            }
        }
        
        /* Responsive images */
        img {
            max-width: 100%;
            height: auto;
        }
        
        /* Responsive typography */
        .heading-1 {
            font-size: clamp(2rem, 5vw, 3.5rem);
            line-height: 1.2;
        }
        
        .heading-2 {
            font-size: clamp(1.5rem, 4vw, 2.5rem);
            line-height: 1.3;
        }
        
        .body-text {
            font-size: clamp(1rem, 2vw, 1.125rem);
            line-height: 1.6;
        }
        
        /* Utility classes */
        .w-full {
            width: 100%;
        }
        
        .h-full {
            height: 100%;
        }
        
        .flex-center {
            display: flex;
            justify-content: center;
            align-items: center;
        }
    </style>
    
    <!-- Alpine.js for interactive components -->
    <script defer src="https://cdn.jsdelivr.net/npm/alpinejs@3.x.x/dist/cdn.min.js"></script>
</head>
